import React from 'react';
import propTypes from 'prop-types';

export const Button = ({ title, click }) => {
  return (
    <button
      style={{
        width: '100px',
        backgroundColor: 'lightgrey',
        borderRadius: '5px'
      }}
      onClick={click}
    >
      {title}
    </button>
  );
}

Button.propTypes = {
  title: propTypes.func,
  click: propTypes.func
};
